import React, { useState, useEffect, Component } from "react";
import MaterialTable from "material-table";
// import Container from "@material-ui/core/Container";
import TableContainer from "@material-ui/core/TableContainer";

import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
// import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";
import Container from "@material-ui/core/Container";

import { authAxios } from "../../utils";
import { orderListURL } from "../../constants";

function Test() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  const columns = [
    { label: "Shop Name", id: "shop_name" },
    { label: "Total Amount", id: "total" },
    { label: "Data", id: "start_date" },
    { label: "Status", id: "order_status" }
  ];

  useEffect(() => {
    const fetchOrders = async () => {
      setLoading(true);
      const res = await authAxios.get(orderListURL);
      setOrders(res.data);
      setLoading(false);
    };

    fetchOrders();
  }, []);

  const useStyles = makeStyles({
    root: {
      width: "100%"
    },
    container: {
      maxHeight: 900
    }
  });

  // export default function StickyHeadTable() {
  const classes = useStyles();
  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(15);
  const [open, setOpen] = React.useState(false);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = event => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return (
    <Container>
      <Paper className={classes.root}>
        <TableContainer className={classes.container}>
          <Table stickyHeader aria-label="sticky table">
            <TableHead>
              <TableRow>
                {columns.map(column => (
                  <TableCell
                    key={column.id}
                    align={column.align}
                    style={{ minWidth: column.minWidth }}
                  >
                    {column.label}
                  </TableCell>
                ))}
              </TableRow>
            </TableHead>
            <TableBody>
              {orders
                .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                .map(order => {
                  return (
                    <TableRow className={classes.root}>
                      <TableCell>
                        <IconButton
                          aria-label="expand row"
                          size="small"
                          onClick={() => setOpen(!open)}
                        >
                          {open ? (
                            <KeyboardArrowUpIcon />
                          ) : (
                            <KeyboardArrowDownIcon />
                          )}
                        </IconButton>
                      </TableCell>
                      <TableCell component="th" scope="row">
                        {order.shop_name}
                      </TableCell>
                      <TableCell align="right">{order.total}</TableCell>
                      <TableCell align="right">{order.start_date}</TableCell>
                      <TableCell align="right">{order.order_status}</TableCell>
                    </TableRow>

                    // <TableRow
                    //   hover
                    //   role="checkbox"
                    //   tabIndex={-1}
                    //   key={row.code}
                    // >
                    //   {columns.map(column => {
                    //     const value = row[column.id];
                    //     return (
                    //       <TableCell key={column.id} align={column.align}>
                    //         {column.format && typeof value === "number"
                    //           ? column.format(value)
                    //           : value}
                    //       </TableCell>
                    //     );
                    //   })}
                    // </TableRow>
                  );
                })}
            </TableBody>
          </Table>
        </TableContainer>
        <TablePagination
          rowsPerPageOptions={[10, 25, 100]}
          component="div"
          count={orders.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onChangePage={handleChangePage}
          onChangeRowsPerPage={handleChangeRowsPerPage}
        />
      </Paper>
    </Container>
  );
}
export default Test;
